import React from 'react';
import './App.css';
import {Link} from 'react-router-dom';

function Nav() {
  return (
    <nav>
      <h3>My Mod 5 Project Journal</h3>
      <ul className="nav-links">
          <link><li>About</li></link>
          <link><li>Journal</li></link>
      </ul>
    </nav>
  );
}

export default Nav;
